import React from 'react';

import Particles from 'react-particles-js';

import Tetris from './components/Tetris';

import './App.css';

const particlesOptions = {

  particles: {
    line_linked: {
      shadow: {
        enable: true,
        color: "#3CA9D1",
        blur: 5
      }
    }
  }
}


const App = () => (

  <div className='App'>

    <Particles className='particles'

        params={particlesOptions}

      >

    <Tetris />

  </Particles>

  </div>


);

export default App;
